    T(NaN, +0, NaN);
    T(NaN, -0, NaN);
    T(NaN, Infinity, NaN);
    T(NaN, -Infinity, NaN);

    T(1, NaN, +0);
    T(1, NaN, -0);

    T(NaN, NaN, NaN);
    T(NaN, NaN, 2.2);
    T(NaN, NaN, 1);
    T(NaN, NaN, -1);
