    T(Infinity, 2, Infinity);
    T(Infinity, -2, Infinity);
    T(0, 2, -Infinity);
    T(0, -2, -Infinity);

    T(+Infinity, 1/1.1, -Infinity);
    T(+Infinity, 1/-1.1, -Infinity);
    T(+Infinity, 1/2, -Infinity);
    T(+Infinity, 1/-2, -Infinity);

    T(NaN, 1, Infinity);
    T(NaN, 1, -Infinity);
    T(NaN, -1, Infinity);
    T(NaN, -1, -Infinity);

